        private void CreatePaletteNode(FlowShapes flowShape, string id)
        {
            DiagramNode diagramNode = new DiagramNode()
            {
                Id = id,
                Shape = new DiagramShape() { Type = DiagramShapes.Flow, FlowShape = flowShape }
            };
            if (id == "Terminator" || id == "Process")
            {
                diagramNode.PreviewSize = new SymbolSizeModel() { Width = 100, Height = 100 };
            }
            else
            {
                diagramNode.PreviewSize = new SymbolSizeModel() { Width = 100, Height = 100 };
            }
            FlowShapeList.Add(diagramNode);
        }

